import React, { useEffect } from 'react';
import Blog from '../../Components/Home/Blog/Blog';
import Footer from '../../Components/Home/Footer/Footer';
import Hero from '../../Components/Home/Hero/Hero';
import Header from '../../Components/Home/NavBar/Header';
import NavBar from '../../Components/Home/NavBar/NavBar';
import OfferCard from '../../Components/Home/OfferCard/OfferCard';
import PictureUpload from '../../Components/Home/PictureUpload/PictureUpload';
import ShopCard from '../../Components/Home/ShopCard/ShopCard';
import VendorCTA from '../../Components/Home/VendorCTA/VendorCTA';

const Home = () => {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  return (
    <>
      {/* Background Image with 3 sections */}
      <div
        className="min-h-auto lg:min-h-screen bg-cover bg-no-repeat bg-center"
        style={{
          backgroundImage: `url(https://www.bankofbaroda.in/-/media/project/bob/countrywebsites/india/business-banking/rural-and-agri/loans-and-advances/agricultural-finance/farm-credit/shg-jlg-fpo/financing-farmer-producer-companies/spotlight/financing-farmer-producer-companies-spotlightbanner.jpg?h=400&iar=0&w=1080&hash=2166B10EA7C4A8DAAD06D895D51F2398)`,
        }}
      >
        <Header />
        <NavBar />
        <Hero />
      </div>
      <OfferCard />
      <ShopCard />
      <PictureUpload />
      <VendorCTA />
      <Blog />
      <Footer />
    </>
  );
};

export default Home;
